/***************************************
***   Static data management script  ***
***************************************/

-- This script will manage the static data from
-- your Team Database project for [sevis].[FieldOfStudy].

PRINT 'Updating static data table [sevis].[FieldOfStudy]'

-- Set date format to ensure text dates are parsed correctly
SET DATEFORMAT ymd

-- Turn off affected rows being returned
SET NOCOUNT ON

-- Change this to 1 to delete missing records in the target
-- WARNING: Setting this to 1 can cause damage to your database
-- and cause failed deployment if there are any rows referencing
-- a record which has been deleted.
DECLARE @DeleteMissingRecords BIT
SET @DeleteMissingRecords = 0

-- 1: Define table variable
DECLARE @tblTempTable TABLE (
[FieldOfStudyId] int,
[FieldOfStudyCode] char(7),
[Description] nvarchar(200),
[HistoryCreatedBy] int,
[HistoryCreatedOn] datetimeoffset,
[HistoryRevisedBy] int,
[HistoryRevisedOn] datetimeoffset
)

-- 2: Populate the table variable with data
-- This is where you manage your data in source control. You
-- can add and modify entries, but because of potential foreign
-- key contraint violations this script will not delete any
-- removed entries. If you remove an entry then it will no longer
-- be added to new databases based on your schema, but the entry
-- will not be deleted from databases in which the value already exists.


-- 3: Insert any new items into the table from the table variable
SET IDENTITY_INSERT [sevis].[FieldOfStudy] ON
SELECT tmp.[FieldOfStudyId], tmp.[FieldOfStudyCode], tmp.[Description], tmp.[HistoryCreatedBy], tmp.[HistoryCreatedOn], tmp.[HistoryRevisedBy], tmp.[HistoryRevisedOn]
FROM @tblTempTable tmp
LEFT JOIN [sevis].[FieldOfStudy] tbl ON tbl.[FieldOfStudyId] = tmp.[FieldOfStudyId]
WHERE tbl.[FieldOfStudyId] IS NULL
SET IDENTITY_INSERT [sevis].[FieldOfStudy] OFF

-- 4: Update any modified values with the values from the table variable
UPDATE LiveTable SET
LiveTable.[FieldOfStudyCode] = tmp.[FieldOfStudyCode],
LiveTable.[Description] = tmp.[Description],
LiveTable.[HistoryCreatedBy] = tmp.[HistoryCreatedBy],
LiveTable.[HistoryCreatedOn] = tmp.[HistoryCreatedOn],
LiveTable.[HistoryRevisedBy] = tmp.[HistoryRevisedBy],
LiveTable.[HistoryRevisedOn] = tmp.[HistoryRevisedOn]
FROM [sevis].[FieldOfStudy] LiveTable 
INNER JOIN @tblTempTable tmp ON LiveTable.[FieldOfStudyId] = tmp.[FieldOfStudyId]

-- 5: Delete any missing records from the target
IF @DeleteMissingRecords = 1
BEGIN
	DELETE FROM [sevis].[FieldOfStudy] FROM [sevis].[FieldOfStudy] LiveTable
	LEFT JOIN @tblTempTable tmp ON LiveTable.[FieldOfStudyId] = tmp.[FieldOfStudyId]
	WHERE tmp.[FieldOfStudyId] IS NULL
END

PRINT 'Finished updating static data table [sevis].[FieldOfStudy]'

-- Note: If you are not using the new GDR version of DBPro
-- then remove this go command.
GO